uint32_t rgba_to_argb(uint32_t rgba)
{
    // Extract each component from the RGBA value
    uint8_t r = (rgba >> 24) & 0xFF; // Red component (most significant byte in RGBA)
    uint8_t g = (rgba >> 16) & 0xFF; // Green component
    uint8_t b = (rgba >> 8) & 0xFF;  // Blue component
    uint8_t a = rgba & 0xFF;         // Alpha component (least significant byte in RGBA)

    // Rearrange into ARGB format
    uint32_t argb = (a << 24) | (r << 16) | (g << 8) | b;

    return argb;
}